const getCookieValue = (name) => {
  const cookies = document.cookie.split(';');
  const res = cookies.find((cookie) => {
    console.log(cookie)
    const c = cookie.trim().split('=')
    if (c[0] === name) console.log(c[1])
    return console.log(false)
  })
  console.log(res);
  return res;
}

export default getCookieValue;
